import React from 'react';
import HomesIcerik from '../Components/HomesIcerik';
import Hikaye from '../data/hikaye.json';


const HomeInstagram = () => {
    return (
        <>
            <div className='w-[630px] mr-[64px]'>
                <div className='inline-flex items-center gap-x-3 mb-6'>
                    {Hikaye.map((story) => (
                        <div key={story.id} className="cursor-pointer">
                            <div className='w-[42px] h-[66px] border-2 border-[#ff0c5e] rounded-full flex items-center justify-center'>
                                <img src={story.image} alt='' className='w-8 h-8 object-contain rounded-full' />
                            </div>
                            <span className='text-xs leading-4 font-normal'>{story.title}</span>
                        </div>
                    ))}
                </div>
                <HomesIcerik />
            </div>
        </>
    );
};

export default HomeInstagram;
